import React, { useEffect, useState } from "react";
import ItemDetail from "./ItemDetailContainer.js";
import dataItem from "../../dataItem/dataItem.js";


function getItem(){
    const dataItem = [
        {
        id: 1,
        name: "Boston Celtics",
        precio: 122,
        imgurl: "https://picsum.photos/200/300",
        descripcion: "Jersey de equipo NBA Boston Celtics año 2017 del Campeonato Copa Del Rey",
        stock: 7,
        },
    ];
};



export default function ItemDetailContain() {
const [ data, setdata] = useState([]);

useEffect(
    () => {
        getItem().then((respuesta) => {
            setdata(respuesta);
        });
    },
    []);


return (<div>
        <h1>Detalles del Producto</h1>
        <p>{dataItem.name}</p>
        <img src={dataItem.imgurl} alt="imagen" />
        <p>{dataItem.pecio}</p>
        <p>{dataItem.descripcion}</p>
        <p>{dataItem.stock}</p>
        <hr/>

</div>
);
}
